function Login(){
    return(
        <div className="Login">
            <form>
                <input type="text" id="username" placeholder="username"></input><br></br>
                <input type="text" id="password" placeholder="password"></input><br></br>
                <input type="submit" id="submit" placeholder=""></input>
            </form>
        </div>
    );
}

export default Login;
